ibutes":{"columns":[{"id":"1679"},{"id":"1680"}],"fit_columns":true,"height":50,"index_position":null,"sizing_mode":"stretch_width","source":{"id":"1678"},"view":{"id":"1683"},"width":0},"id":"1681","type":"DataTable"},{"attributes":{},"id":"1779","type":"StringEditor"},{"attributes":{"line_alpha":0.1,"line_color":"#dc143c","x":{"field":"index"},"y":{"field":"2563735917264"}},"id":"1406","type":"Line"},{"attributes":{"editor":{"id":"1759"},"field":"col0","formatter":{"id":"1758"},"title":"Name"},"id":"1679","type":"TableColumn"},{"attributes":{},"id":"1603","type":"StringEditor"},{"attributes":{"css_classes":["source-pre"],"sizing_mode":"stretch_width","text":"class FortyDaySMAStrategy(bt.Strategy):\n    params = (('sma_period', PERIOD),\n              ('atr_period', ATR_PERIOD),\n              ('di_period', 22)\n              )\n    scale_factor = 2\n\n    def __init__(self):\n        # \u9009\u62e9\u65f6\u95f4\u5468\u671f\n        timeperiod = 125\n\n        # \u8ba1\u7b97ROC\n        self.ROC = bt.talib.ROC(self.data.close, timeperiod=timeperiod)\n\n        # \u8ba1\u7b97ROCP\n        self.ROCP = bt.talib.ROCP(self.data.close, timeperiod=timeperiod)\n\n        # \u8ba1\u7b97ROCR\n        self.ROCR = bt.talib.ROCR(self.data.close, timeperiod=timeperiod)\n\n        # \u8ba1\u7b97ROCR100\n        self.ROCR100 = bt.talib.ROCR100(self.data.close, timeperiod=timeperiod)\n\n        # self.ROCP.plotinfo.plotmaster = self.ROC\n        self.ROCR.plotinfo.plotmaster = self.ROCP\n        self.ROCR100.plotinfo.plotmaster = self.ROC\n\n        self.buy_index = None\n        self.sell_index = None\n\n        # self.indicators()\n\n    def indicators(self):\n        # \u5bf9\u7eb3\u6307\u6709\u6548\n        self.adx = bt.talib.ADX(self.data.high, self.data.low, self.data.close, timeperiod=self.params.di_period)\n        self.adxr = bt.talib.ADXR(self.data.high, self.data.low, self.data.close, timeperiod=self.params.di_period)\n        self.adxr.plotinfo.plotmaster = self.adx\n        # ADXR(high, low, close, timeperiod=14)\n        # \u8ba1\u7b97 +DI \u548c -DI\n        self.plus_di = bt.talib.PLUS_DI(self.data.high, self.data.low, self.data.close,\n                                        timeperiod=self.params.di_period)\n        self.minus_di = bt.talib.MINUS_DI(self.data.high, self.data.low, self.data.close,\n                                          timeperiod=self.params.di_period)\n        self.minus_di.plotinfo.plotmaster = self.plus_di\n\n        # \u8ba1\u7b97 APO\n        self.apo = bt.talib.APO(self.data, fastperiod=20, slowperiod=100, matype=3)\n\n        # \u8ba1\u7b97 AROON Up \u548c AROON Down\n        self.aroon = bt.talib.AROON(self.data.high, self.data.low, timeperiod=self.params.sma_period)\n        self.aroonosc = bt.talib.AROONOSC(self.data.high, self.data.low, timeperiod=self.params.sma_period)\n        self.aroonosc.plotinfo.plotmaster = self.aroon\n\n        # \u8ba1\u7b97 BOP\n        self.bop = bt.talib.BOP(self.data.open, self.data.high, self.data.low, self.data.close)\n\n        # self.buy_index = None\n        # self.sell_index = None\n        self.cci = bt.talib.CCI(self.data.high, self.data.low, self.data.close, timeperiod=PERIOD)\n        self.buy_index = self.cci &gt;= 100\n        self.sell_index = self.cci &lt;= -100\n        self.position_percent = 0\n\n        # \u5bf9\u7eb3\u6307\u6709\u6548\n        # \u8ba1\u7b97 CMO\n        self.cmo = bt.talib.CMO(self.data, timeperiod=PERIOD)\n\n        # \u5bf9\u7eb3\u6307\u6709\u6548\n        self.DX = bt.talib.DX(self.data.high, self.data.low, self.data.close, timeperiod=PERIOD)\n        self.DXR = bt.talib.EMA(self.DX, timeperiod=66)\n        self.plus_di = bt.talib.PLUS_DI(self.data.high, self.data.low, self.data.close,\n                                        timeperiod=PERIOD)\n        self.minus_di = bt.talib.MINUS_DI(self.data.high, self.data.low, self.data.close,\n                                          timeperiod=PERIOD)\n        self.plus_di.plotinfo.plotmaster = self.DX\n        self.minus_di.plotinfo.plotmaster = self.DX\n        self.DXR.plotinfo.plotmaster = self.DX\n\n        # \u5bf9\u7eb3\u6307  \u4e70\u70b9\u8f83\u6709\u6548\n        scale_factor = 1\n        self.macd = bt.talib.MACD(self.data.close, fastperiod=12*scale_factor, slowperiod=26*scale_factor, signalperiod=9*scale_factor)\n\n        # \u4e0eMACD\u96f7\u540c\uff0c\u7528\u6765\u505a\u4e70\u70b9\u7684\u9009\u5728\u6bd4\u8f83\u6709\u6548\n        scale_factor = 2\n        self.MACDEXT = bt.talib.MACDEXT(self.data.close,\n                                        fastperiod=12*scale_factor, fastmatype=1,\n                                        slowperiod=26*scale_factor, slowmatype=0,\n                                        signalperiod=9*scale_factor, signalmatype=0)\n\n        # \u8ba1\u7b97 MFI \u6307\u6807\n        self.mfi = bt.talib.MFI(self.data.high, self.data.low, self.data.close, self.data.volume, timeperiod=22)\n\n        # \u5bf9\u7eb3\u6307\u65e0\u6548\n        self.MOM = bt.talib.real = bt.talib.MOM(self.data.close, timeperiod=22)\n\n        # \u5bf9\u7eb3\u6307\u65e0\u6548\n        self.PPO = bt.talib.PPO(self.data.close, fastperiod=12, slowperiod=26, matype=0)\n        self.PPO_EMA_signal = bt.talib.EMA(self.PPO, timeperiod=9)\n        self.PPO_hist = self.PPO - self.PPO_EMA_signal\n        self.EMA.plotinfo.plotmaster = self.PPO\n        # talib.ADX()\n\n    def next(self):\n        # if self.buy_index:\n        #     # self.buy()\n        #     self.position_percent += 0.2\n        #     self.position_percent = 1 if self.position_percent &gt; 1 else self.position_percent\n        #     self.order = self.order_target_percent(target=self.position_percent)\n        # if self.sell_index:\n        #     # self.sell()\n        #     self.position_percent -= 0.4\n        #     self.position_percent = 0 if self.position_percent &lt; 0 else self.position_percent\n        #     self.order = self.order_target_percent(target=self.position_percent)\n        pass\n"},"id":"1803","type":"Div"},{"attributes":{},"id":"1757","type":"Selection"},{"attributes":{"source":{"id":"1686"}},"id":"1691","type":"CDSView"},{"attributes":{"line_color":"#dc143c","x":{"field":"index"},"y":{"field":"2563735917264"}},"id":"1405","type":"Line"},{"attributes":{"editor":{"id":"1610"},"field":"col0","formatter":{"id":"1564"},"title":"Period"},"id":"1565","type":"TableColumn"},{"attributes":{"data":{"col0":["timeframe","compression"],"col1":["Day","1"]},"selected":{"id":"1745"},"selection_policy":{"id":"1744"}},"id":"1655","type":"ColumnDataSource"},{"attributes":{},"id":"1564","type":"StringFormatter"},{"attributes":{},"id":"1127","type":"AllLabels"},{"attributes":{"active_multi":null,"tools":[{"id":"1306"},{"id":"1307"},{"id":"1308"},{"id":"1309"},{"id":"1321"},{"id":"1459"},{"id":"1449"}]},"id":"1311","type":"Toolbar"},{"attributes":{},"id":"1758","type":"StringFormatter"},{"attributes":{},"id":"1780","type":"UnionRenderers"},{"attributes":{"label":{"value":"BuySell (True, 0.015) buy"},"renderers":[{"id":"1251"}]},"id":"1267","type":"LegendItem"},{"attributes":{},"id":"1760","type":"StringFormatter"},{"attributes":{"data":{"2563735916112":{"__ndarray__":"AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAAAAD4fwAAAAAAAPh/AAAAAAAA+H8AAAAA
